2136	multiple_choice	Sa isang paligsahan ng pagbigkas ng tula, si Maria ay nasa ika-67 na posisyon mula sa unahan. Kung si Jose ay nasa ika-75 na posisyon, ilang posisyon ang pagitan nina Maria at Jose?	{"hint": "Ibawas ang mas mababang posisyon sa mas mataas na posisyon para makuha ang pagitan."}	2	8635	English	2025-05-09 07:23:51.258+00	2025-05-09 08:31:56.621+00	3	approved	\N	manual	["A. 7 posisyon", "B. 8 posisyon", "C. 9 posisyon", "D. 10 posisyon"]	B. 8 posisyon	Si Maria ay nasa ika-67, at si Jose ay nasa ika-75. Ang pagitan ng kanilang posisyon ay 75 - 67 = 8. Samakatuwid, may 8 posisyon ang pagitan nila.
2137	multiple_choice	Sa isang paligsahan ng pagsayaw, si Lita ay nasa ika-33 na posisyon mula sa unahan. Kung si Juan ay 12 posisyon sa harap ni Lita, anong posisyon ang kinaroroonan ni Juan?	{"hint": "Kung nasa harap, ibawas ang bilang ng posisyon sa posisyon ni Lita."}	2	8635	English	2025-05-09 07:23:51.258+00	2025-05-09 08:31:56.621+00	3	approved	\N	manual	["A. Ika-21", "B. Ika-23", "C. Ika-45", "D. Ika-51"]	A. Ika-21	Si Lita ay nasa ika-33 na posisyon. Si Juan ay 12 posisyon sa harap, kaya 33 - 12 = 21. Samakatuwid, si Juan ay nasa ika-21 na posisyon.
2138	fill_in_blank	Sa isang pila ng 100 tao, si Rosa ay nasa ika-88 na posisyon mula sa unahan. Kung si Pedro ay nasa ika-95 na posisyon, sino ang mas malapit sa dulo ng pila?	{"hint": "Alamin kung sino ang mas malapit sa 100 (dulo) sa pamamagitan ng pagkalkula ng layo ng bawat isa mula sa 100."}	3	8635	English	2025-05-09 07:23:51.258+00	2025-05-09 08:31:56.621+00	3	approved	\N	manual	\N	Pedro	Si Rosa ay nasa ika-88, at si Pedro ay nasa ika-95 sa kabuuang 100 tao. Ang layo mula sa dulo ay: Rosa = 100 - 88 = 12; Pedro = 100 - 95 = 5. Dahil 5 < 12, si Pedro ang mas malapit sa dulo.
