6007	multiple_choice	Aling pamilang na pangungusap ang katumbas ng (8 X 10 = 10 X 8)?	{"hint": "Ipinapakita ng kakanyahang komutatibo na ang pagpapalit ng mga factor ay nagbibigay ng parehong produkto. Suriin kung aling mga opsyon ang nagpapakita ng produkto ng (8 X 10)."}	1	8649	Tagalog	2025-05-14 10:02:42.829+00	2025-05-14 10:02:42.829+00	3	approved	\N	manual	["(8 + 10 = 10 + 8)", "(8 X 10 = 80)", "(10 X 8 = 80)", "Parehong B at C"]	D	Ang kakanyahang komutatibo ay nagsasabi na (8 X 10 = 10 X 8), at pareho itong 80. Ang opsyon B ((8 X 10 = 80)) at opsyon C ((10 X 8 = 80)) ay tamang mga pamilang na pangungusap na nagpapakita ng pagkakatumbas na ito. Ang opsyon A ay tungkol sa pagdaragdag, na hindi nauugnay dito. Halimbawa, kung maghahanda ka ng 8 grupo ng 10 Everlasting para sa isang okasyon sa Marikina, pareho ang bilang kahit baligtarin ang pagkakasunod.
6005	multiple_choice	Kumpletuhin ang pamilang na pangungusap upang maipakita ang kakanyahang asosyatibo: ((2 X 7) X __ = 2 X (7 X 3)).	{"hint": "Ang kakanyahang asosyatibo ay tungkol sa pagpapangkat ng mga factor. Ang kanang bahagi ay (2 X (7 X 3)), kaya anong bilang sa kaliwa ang gagawing tama ang ekwasyon?"}	2	8649	Tagalog	2025-05-14 10:02:42.829+00	2025-05-14 10:11:18.734+00	3	approved	\N	manual	["2", "3", "7", "14"]	3	Sinasabi ng kakanyahang asosyatibo na ((a X b) X c = a X (b X c)). Sa ((2 X 7) X __ = 2 X (7 X 3)), ang nawawalang factor ay 3, dahil ((2 X 7) X 3 = 2 X (7 X 3)). Parehong katumbas ng (2 X 7 X 3 = 42) ang dalawang panig, na nagpapatunay ng pagkakatumbas.
6004	multiple_choice	Alin sa mga sumusunod ang tamang pagpapakita ng kakanyahang pamamahagi ng pagpaparami?	{"hint": "Ang kakanyahang pamamahagi ay nangangailangan ng pagdaragdag ng mga produkto ng mga hinati na termino. Suriin ang bawat opsyon sa pamamagitan ng pagkalkula ng kaliwa at kanang bahagi upang makita kung alin ang nananatiling pareho."}	3	8649	Tagalog	2025-05-14 10:02:42.829+00	2025-05-14 10:11:53.941+00	3	approved	\N	manual	["(23 X 4 = (20 X 4) X (3 X 4))", "(23 X 4 = (20 X 4) + (3 X 4))", "(23 X 4 = (20 X 4) - (3 X 4))", "(23 X 4 = (20 X 4) ÷ (3 X 4))"]	(23 X 4 = (20 X 4) + (3 X 4))	Kalkulahin ang (23 X 4 = 92). Sa opsyon B, ((20 X 4) + (3 X 4) = 80 + 12 = 92), na tama. Ang opsyon A ay gumagamit ng pagpaparami sa halip na pagdaragdag ((80 X 12 = 960)), ang opsyon C ay gumagamit ng pagbabawas ((80 - 12 = 68)), at ang opsyon D ay gumagamit ng paghahati ((80 ÷ 12 ≈ 6.67)), na hindi katumbas ng 92. Kaya, ang opsyon B lamang ang tamang nagpapakita ng kakanyahang pamamahagi.
6003	multiple_choice	Anong kakanyahan ng pagpaparami ang ipinapakita sa pamilang na pangungusap na (23 X 4 = (20 X 4) + (3 X 4))?	{"hint": "Ang kakanyahang pamamahagi ay nangangailangan ng paghahati ng bilang sa mga bahagi at pagpaparami ng bawat bahagi nang hiwalay. Suriin kung hinati ang 23 sa mga bahagi at pinarami sa 4."}	3	8649	Tagalog	2025-05-14 10:02:42.829+00	2025-05-14 10:12:07.966+00	3	approved	\N	manual	["Kakanyahang Komutatibo", "Kakanyahang Pamamahagi", "Kakanyahang Asosyatibo", "Wala sa nabanggit"]	Kakanyahang Pamamahagi	Ang kakanyahang pamamahagi ay nagsasabi na (a X (b + c) = (a X b) + (a X c)). Dito, ang (23 X 4) ay ipinahayag bilang ((20 X 4) + (3 X 4)), kung saan ang 23 ay hinati sa (20 + 3), at ang 4 ay ibinahagi sa bawat bahagi. Halimbawa, (20 X 4 = 80), (3 X 4 = 12), at (80 + 12 = 92), na katumbas ng (23 X 4 = 92).
